literals:
font-size: 24px;
    font-weight: 600;
    color: #486791;
    max-width: 500px;
    margin: 0 auto;

background: linear-gradient(93.96deg, #9B51E0 0%, #3436E7 100%);
    box-shadow: 0px 10px 20px 0px #6529FF26;
    color: white;
    border-radius: 30px;
    border: none;
    padding: 16px 60px;
    font-weight: 600;
    font-size: 24px;
    justify-self: center;

width: 500px;
    margin: 50px auto;
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-gap: 10px;
